import React, { useRef, useEffect, useState } from "react";
import { Stage, Layer, Text, Rect, Transformer } from "react-konva";
import logo from "../Assets/logo-coral.png";
import axiosClient from "../app-axios";
import "./Canvas.css";

const DetailsPanel = ({ item, updateItem, deleteItem, isExpanded }) => {
  const handleInputChange = (prop, value) => {
    updateItem(item.id, { ...item, [prop]: value });
  };

  const confirmDeletion = () => {
    if (window.confirm("¿Estás seguro de que deseas eliminar este elemento?")) {
      deleteItem(item.id);
    }
  };

  return (
    <>
      <div
        style={{
          padding: "10px",
          border: "1px solid #ccc",
          marginBottom: "10px",
          backgroundColor: "gray",
          boxShadow: "0px 0px 8px 0px rgba(255,255,250,1)",
          borderRadius: "5px",
          color: "white",
        }}
      >
        <details open={isExpanded}>
          <summary>
            ID: {item.id} <button onClick={confirmDeletion}>Eliminar</button>
          </summary>
          {item.type === "text" && (
            <>
              <p>
                <label>Text: </label>
                <input
                  type="text"
                  value={item.text}
                  onChange={(e) => handleInputChange("text", e.target.value)}
                />
              </p>
              <p>
                <label>Font Size: </label>
                <input
                  type="number"
                  value={item.fontSize}
                  onChange={(e) =>
                    handleInputChange("fontSize", parseInt(e.target.value))
                  }
                />
              </p>
              <p>
                <label>Font Family: </label>
                <select
                  value={item.fontFamily}
                  onChange={(e) =>
                    handleInputChange("fontFamily", e.target.value)
                  }
                >
                  <option value="Arial">Arial</option>
                  <option value="Verdana">Verdana</option>
                  <option value="Helvetica">Helvetica</option>
                  <option value="Times New Roman">Times New Roman</option>
                  <option value="Courier New">Courier New</option>
                </select>
              </p>
              <p>
                <label>Font Color: </label>
                <input
                  type="color"
                  value={item.textColor}
                  onChange={(e) =>
                    handleInputChange("textColor", e.target.value)
                  }
                />
              </p>
            </>
          )}
          <p>
            <label>X: </label>
            <input
              type="number"
              value={item.x}
              onChange={(e) => handleInputChange("x", parseInt(e.target.value))}
            />
          </p>
          <p>
            <label>Y: </label>
            <input
              type="number"
              value={item.y}
              onChange={(e) => handleInputChange("y", parseInt(e.target.value))}
            />
          </p>
          <p>
            <label>Width: </label>
            <input
              type="number"
              value={item.width}
              onChange={(e) =>
                handleInputChange("width", parseInt(e.target.value))
              }
            />
          </p>
          <p>
            <label>Height: </label>
            <input
              type="number"
              value={item.height}
              onChange={(e) =>
                handleInputChange("height", parseInt(e.target.value))
              }
            />
          </p>
          <p>
            <label>Rotation: </label>
            <input
              type="number"
              value={item.rotation}
              onChange={(e) =>
                handleInputChange("rotation", parseFloat(e.target.value))
              }
            />
          </p>
          {item.type === "rect" && (
            <p>
              <label>Fill Color: </label>
              <input
                type="color"
                value={item.fillColor}
                onChange={(e) => handleInputChange("fillColor", e.target.value)}
              />
            </p>
          )}
        </details>
      </div>
    </>
  );
};

const generateHTML = (items) => {
  const htmlElements = items
    .map((item) => {
      if (item.type === "text") {
        return `<div style="position: absolute; left: ${item.x}px; top: ${item.y}px; font-size: ${item.fontSize}px; color: ${item.textColor};">${item.text}</true>`;
      } else if (item.type === "rect") {
        return `<div style="position: absolute; left: ${item.x}px; top: ${item.y}px; width: ${item.width}px; height: ${item.height}px; background-color: ${item.fillColor};"></div>`;
      }
      return "";
    })
    .join("");

  return `<!DOCTYPE html>
  <html>
  <head>
  <title>Plantilla</title>
  <style>
  body, html { margin: 0; height: 1056px; ; width: 816px; overflow: hidden; background-color: gray;}
  #canvas { width: 816px; height: 1056px; background-color: white; position: relative; }
</style>
  </head>
  <body>
  <div id="canvas">
  ${htmlElements}
  </div>
  </body>
  </html>`;
};

const downloadHtmlFile = (html) => {
  const blob = new Blob([html], { type: "text/html" });
  const url = URL.createObjectURL(blob);
  const a = document.createElement("a");
  a.href = url;
  a.download = "plantilla.html";
  document.body.appendChild(a);
  a.click();
  document.body.removeChild(a);
};

const CanvasEditor = () => {
  const [items, setItems] = useState([]);
  console.log(items);
  const [selectedId, setSelectedId] = useState(null);
  const [expandedPanelId, setExpandedPanelId] = useState(null);
  const trRef = useRef();

  useEffect(() => {
    // Verifica si el elemento seleccionado aún existe
    const selectedNode = items.find((item) => item.id === selectedId);
    if (selectedNode && trRef.current) {
      trRef.current.nodes([selectedNode.shapeRef.current]);
      trRef.current.getLayer().batchDraw();
    } else {
      // Si no existe, asegúrate de que no hay ningún nodo en el Transformer
      if (trRef.current) {
        trRef.current.nodes([]);
        trRef.current.getLayer().batchDraw();
      }
    }
  }, [selectedId, items]);

  const handleSaveTemplate = () => {
    const html = generateHTML(items);
    downloadHtmlFile(html);
  };

  const addText = () => {
    const newText = {
      type: "text",
      x: 100,
      y: 100,
      text: "Nuevo Texto",
      fontSize: 20,
      textColor: "black",
      fontFamily: "Arial",
      id: `text_${items.length}`,
      draggable: true,
      width: "auto",
      height: "auto",
      rotation: 0,
      shapeRef: React.createRef(),
    };
    setItems([...items, newText]);
  };

  const addRect = () => {
    const newRect = {
      type: "rect",
      x: 180,
      y: 180,
      width: 100,
      height: 50,
      fillColor: "#C5C5C5",
      id: `rect_${items.length}`,
      draggable: true,
      rotation: 0,
      shapeRef: React.createRef(),
    };
    setItems([...items, newRect]);
  };

  const addVariable = (name) => {
    const newVariable = {
      type: "text",
      x: 150,
      y: 150,
      text: name,
      fontSize: 20,
      color: "black",
      id: `var_${items.length}`,
      draggable: true,
      width: "auto",
      height: "auto",
      rotation: 0,
      shapeRef: React.createRef(),
    };
    setItems([...items, newVariable]);
  };

  const updateItem = (id, updatedProps) => {
    const updatedItems = items.map((item) =>
      item.id === id ? updatedProps : item
    );
    setItems(updatedItems);
  };

  const deleteItem = (id) => {
    const updatedItems = items.filter((item) => item.id !== id);
    setItems(updatedItems);
    if (selectedId === id) {
      setSelectedId(null);
    }
  };

  // Función que maneja el evento de teclado
  const handleKeyPress = (event) => {
    if (event.key === "Delete") {
      // Asegúrate de que la tecla es 'Delete'
      if (selectedId) {
        deleteItem(selectedId);
      }
    }
  };

  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axiosClient.get("/variables");
        setData(response.data);
      } catch (error) {
        console.error("Error al obtener los datos:", error);
      }
    };

    fetchData();
  }, []); // El arreglo vacío asegura que el efecto se ejecute solo una vez

  // Agrega el event listener cuando el componente se monta
  useEffect(() => {
    window.addEventListener("keydown", handleKeyPress);
    return () => {
      window.removeEventListener("keydown", handleKeyPress);
    };
  }, [selectedId]); // Asegúrate de que useEffect se actualice si selectedId cambia

  //   tamaños del lienzo

  const letterWidthInches = 8.5; // Width of letter paper
  const letterHeightInches = 11; // Height of letter paper
  const pixelsPerInch = 96; // Assuming 96 pixels per inch
  const width = letterWidthInches * pixelsPerInch;
  const height = letterHeightInches * pixelsPerInch;

  return (
    <>
      <div className="header">
        <img src={logo} width={90} style={{ margin: 12 }} />
        <div>
          <button onClick={addText}>Añadir Texto</button>
          <button onClick={addRect}>Añadir Rectángulo</button>
        </div>
        <button onClick={handleSaveTemplate}>Guardar Plantilla</button>
      </div>
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          backgroundColor: "#37404D",
          paddingTop: "65px",
        }}
      >
        <div style={{ backgroundColor: "gray", width: "18%" }}>
          Hola
          {data ? (
            <ul>
              {data.map((item, index) => (
                <div
                  style={{
                    backgroundColor: "white",
                    display: "flex",
                    justifyContent: "space-around",
                    flexDirection: "row",
                  }}
                >
                  <div style={{ width: "100%" }} key={index}>
                    {item.name}{" "}
                    <button onClick={() => addVariable(item.name)}>+</button>
                  </div>
                </div>
              ))}
            </ul>
          ) : (
            <p>Cargando datos...</p>
          )}
        </div>
        <div
          style={{
            width: "60%",
            height: "89vh",
            justifyContent: "center",
            display: "flex",
            overflow: "auto",
            padding: "20px",
          }}
        >
          <div>
            <Stage
              width={width}
              height={height}
              style={{
                backgroundImage:
                  "url('data:image/png;base64,')",
              }}
              onMouseDown={(e) => {
                const clickedOnEmpty = e.target === e.target.getStage();
                if (clickedOnEmpty) {
                  setSelectedId(null);
                  setExpandedPanelId(null);
                }
              }}
            >
              <Layer>
                {/* {items.map((item, idx) =>
                  React.createElement(item.type === "text" ? Text : Rect, {
                    key: idx,
                    ...item,
                    ref: item.shapeRef,
                    onClick: () => {
                      setSelectedId(item.id);
                      setExpandedPanelId(item.id);
                    },
                    onTap: () => {
                      setSelectedId(item.id);
                      setExpandedPanelId(item.id);
                    },
                    onDragEnd: (e) => {
                      setSelectedId(item.id);
                      setExpandedPanelId(item.id);
                      const updated = {
                        ...item,
                        x: e.target.x(),
                        y: e.target.y(),
                      };
                      updateItem(item.id, updated);
                    },
                    onTransformEnd: (e) => {
                      const node = e.target;
                      const updated = {
                        ...item,
                        x: node.x(),
                        y: node.y(),
                        width: node.width() * node.scaleX(),
                        height: node.height() * node.scaleY(),
                        rotation: node.rotation(),
                      };
                      updateItem(item.id, updated);
                    },
                  })
                )} */}
                {items.map((item, idx) =>
                  React.createElement(item.type === "text" ? Text : Rect, {
                    key: idx,
                    ...item,
                    ref: item.shapeRef,
                    fill:
                      item.type === "text" ? item.textColor : item.fillColor,
                    onClick: () => {
                      setSelectedId(item.id);
                      setExpandedPanelId(item.id);
                    },
                    onTap: () => {
                      setSelectedId(item.id);
                      setExpandedPanelId(item.id);
                    },
                    onDragEnd: (e) => {
                      setSelectedId(item.id);
                      setExpandedPanelId(item.id);
                      updateItem(item.id, {
                        ...item,
                        x: e.target.x(),
                        y: e.target.y(),
                      });
                    },
                    onTransformEnd: (e) => {
                      const node = e.target;
                      const scaleX = node.scaleX();
                      const scaleY = node.scaleY();
                      updateItem(item.id, {
                        ...item,
                        x: node.x(),
                        y: node.y(),
                        width: node.width() * scaleX,
                        height: node.height() * scaleY,
                        rotation: node.rotation(),
                      });
                    },
                  })
                )}

                <Transformer ref={trRef} />
              </Layer>
            </Stage>
          </div>
        </div>

        <div
          style={{
            width: "18%",
            padding: "10px",
            borderLeft: "1px solid gray",
            overflow: "auto",
            height: "92vh",
          }}
        >
          <div style={{ paddingBottom: "10px", color: "white" }}>Elementos</div>
          {items.map((item) => (
            <DetailsPanel
              key={item.id}
              item={item}
              updateItem={updateItem}
              deleteItem={deleteItem}
              isExpanded={item.id === expandedPanelId}
            />
          ))}
        </div>
      </div>
    </>
  );
};

export default CanvasEditor;
